import React, { useState } from 'react';
import './style.css';

function AddButton() {
  const [name, setName] = useState(0);
  const [aaayyy, setAAAYYY] = useState([]);
  let arg1:[]=[]
  let arg2:[]=[]
  const logs = (number:number,arg1:[],arg2:[])=>{
    setName(number+1);
    const arrays = ():[] => {
      let arg2 = [...Array(number)].map((_,i) => i+1)
      Array.prototype.push.apply(arg1, arg2)
    }
    const newArys:[] = arrays();
    console.log(newArys)
    setAAAYYY(newArys);
  }

  return (
    <div>
      <h2>増えるボタン</h2>
      {aaayyy.map((counkey:number) => {
        return <div className="divbtn" onClick={logs(name,arg1,arg2)} key={counkey.toString()}>{name}</div>
      })}
    </div>
  );
}

export default AddButton;
